svg.script:

	var time = 5;
	var delta_time = 0.01;
	var dir = 1;
	var max_time = 5;
	var conduction_x = -38.0;
	var mask_x = -25.0;
	var max_distance = 25;
	var power = 0;
	var delay;

	function Start(evt) {
		mask       = evt.target.ownerDocument.getElementById("g3937");
		PowerVal   = evt.target.ownerDocument.getElementById("tspan3025");

		Slide();
	}
	function Slide() {
		time = time + delta_time * dir;
		if (time > max_time || time < 0)
			dir *= -1;
		x_pos = (time / max_time) * max_distance;
		mask_x_pos = mask_x + x_pos;
		mask.setAttribute("transform", "translate(" +mask_x_pos+ ", 0.0 )");
		mask.setAttribute("visibility","hidden");
		delay = time / max_time * Math.PI;
		power = 100 * ((Math.PI - delay)/Math.PI + Math.sin(2 * delay)/2/Math.PI);
		power = Math.round(power);
		PowerVal.textContent = power+"%";
		// Repeat
		setTimeout("Slide()", delta_time)
	}
	window.translate = Slide;

/*

Vload=Vpeak*sqrt((2p-2f+sin2f)/4p)
Power = PkPower * (2p-2f+sin2f)/4p


Where
f = triac-angle-delay=triggering-angle
p = (pi)

for f = 0, triac is full on
*/
